import React, { Component } from 'react';
import './styles.css';

class Home extends Component {

    render() {
        return (
            <div>
                <div className="nav-bar-home">
                    <div className="nav-bar-sub-home">
                        <label>SEIMS</label>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
